import React from "react";

const Todo = () => {
  return (
    <TodoWrapper>
      <TodoUserInfo>
        <span>님 환영합니다!</span>
        <LogOutButton>로그아웃</LogOutButton>
      </TodoUserInfo>
      <TodoListBody></TodoListBody>
    </TodoWrapper>
  );
};

export default Todo;
